  Customer? updatedBy;
  dynamic approvedBy;
  dynamic rejectedBy;
  Customer? customer;
  Customer? estimator;
  Customer? salesperson;
  VehicleEntity? vehicle;
  String? hashId;
  List<HistoriesEntity>? histories;
  List<DocumentsEntity>? documents;

  @override
  String toString() {
    return 'RequestEntity{hashId:$hashId, vinNo: $vinNo, requestNo: $requestNo, step: $step, estimatedPriceFromSource: $estimatedPriceFromSource, estimatedPriceFrom: $estimatedPriceFrom, estimatedPriceTo: $estimatedPriceTo, finalPrice: $finalPrice, proposedPrice: $proposedPrice, estimatedPriceFrom: $estimatedPriceFrom, estimatedPriceTo:$estimatedPriceTo, status: $status, isAcceptSuggestedPrice:$isAcceptSuggestedPrice}';
  }

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['requestNo'] = requestNo;
    map['step'] = step;
    map['estimatedPriceFromSource'] = estimatedPriceFromSource;
    map['estimatedPriceFrom'] = estimatedPriceFrom;
    map['estimatedPriceTo'] = estimatedPriceTo;
    map['finalPrice'] = finalPrice;
    map['proposedPrice'] = proposedPrice;
    map['customerExpectedPrice'] = customerExpectedPrice;
    map['status'] = status;
    map['rejectedReason'] = rejectedReason;
    map['sellingPurpose'] = sellingPurpose;
    map['sellingPurposeNote'] = sellingPurposeNote;
    map['isVipCustomer'] = isVipCustomer;
    map['numberOfPriceCheck'] = numberOfPriceCheck;
    if (createdBy != null) {
      map['createdBy'] = createdBy?.toJson();
    }
    if (updatedBy != null) {
      map['updatedBy'] = updatedBy?.toJson();
    }
    map['approvedBy'] = approvedBy;
    map['rejectedBy'] = rejectedBy;
    if (customer != null) {
      map['customer'] = customer?.toJson();
    }
    if (estimator != null) {
      map['estimator'] = estimator?.toJson();
    }
    if (histories != null) {
      map['histories'] = histories?.map((v) => v.toJson()).toList();
    }
    if (salesperson != null) {
      map['salesperson'] = salesperson?.toJson();
    }
    if (documents != null) {
      map['documents'] = documents?.map((v) => v.toJson()).toList();
    }
    if (vehicle != null) {
      map['vehicle'] = vehicle?.toJson();
    }
    map['hashId'] = hashId;
    map.removeWhere((dynamic key, dynamic value) => key == null || value == null || value == '');
    return map;
  }
}
